import react from "react";
import NoteContext from "./noteContext";

const NoteState = (props)=> {
    const state = {
        "name" : "Minaz",
        "class" : "17th"
    }
    return (
        <NoteState.Provider value={state}>
            {props.children}
        </NoteState.Provider>
    )
}

export default NoteState;
